eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   krishnaQuotes: () => (/* binding */ krishnaQuotes)\n/* harmony export */ });\nconst krishnaQuotes = [\n    {\n        text: \"When the senses contact sense objects, a person experiences cold or heat, pleasure or pain. These experiences are fleeting; they come and go. Bear them patiently, Arjuna. Those who are unaffected by these changes, who are the same in pleasure and pain, are truly wise and fit for immortality. Assert your strength and realize this!\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"The impermanent has no reality; reality lies in the eternal. Those who have seen the boundary between these two have attained the end of all knowledge.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"Realize that which pervades the universe and is indestructible; no power can affect this unchanging, imperishable reality. The body is mortal, but that which dwells in the body is immortal and immeasurable.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"The Self cannot be pierced by weapons or burned by fire; water cannot wet it, nor can the wind dry it. The Self cannot be pierced or burned, made wet or dry. It is everlasting and infinite, standing on the motionless foundations of eternity. The Self is unmanifested, beyond all thought, beyond all change.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"On this path, effort never goes to waste, and there is no failure. Even a little effort toward spiritual awareness will protect you from the greatest fear.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those whose minds are swept away by the pursuit of pleasure and power are incapable of following the supreme goal and will not attain samadhi.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"You have the right to work, but never to the fruit of work. You should never engage in action for the sake of reward, nor should you long for inaction.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"Perform work in this world, Arjuna, as a man established within himself - without selfish attachments, and alike in success and defeat. For yoga is perfect evenness of mind.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"Seek refuge in the attitude of detachment and you will amass the wealth of spiritual awareness. Those who are motivated only by desire for the fruits of action are miserable, for they are constantly anxious about the results of what they do. When consciousness is unified, however, all vain anxiety is left behind. There is no cause for worry, whether things go well or ill. Therefore, devote yourself to the disciplines of yoga, for yoga is skill in action.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"They live in wisdom who see themselves in all and all in them, who have renounced every selfish desire and sense craving tormenting the heart.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"Neither agitated by grief nor hankering after pleasure, they live free from lust and fear and anger. Established in meditation, they are truly wise. Fetterened no more by selfish attachments, they are neither elated by good fortune nor depressed by bad. Such are the seers.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"When you keep thinking about sense objects, attachment comes. Attachment breeds desire, the lust of possession that burns to anger. Anger clouds the judgment; you can no longer learn from past mistakes. Lost is the power to choose between what is wise and what is unwise, and your life is utter waste. But when you move amidst the world of sense, free from attachment and aversion alike, there comes the peace in which all sorrows end, and you live in the wisdom of the Self.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"When you let your mind follow the call of the senses, they carry away your better judgment as storms drive a boat off its charted course on the sea.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"They are forever free who renounce all selfish desires and break away from the ego-cage of ‘I’, ‘me’, and ‘mine’ to be united with the Lord. This is the supreme state. Attain to this, and pass from death to immortality.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 2\",\n        prompt: \"\"\n    },\n    {\n        text: \"Fulfill all your duties; action is better than inaction. Even to maintain your body, Arjuna, you are obliged to act. Selfish action imprisons the world. Act selflessly, without any thought of personal profit.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"Through selfless service, you will always be fruitful and find the fulfillment of your desires’: this is the promise of the Creator.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"But those who realize the Self are always satisfied. Having found the source of joy and fulfillment, they no longer seek happiness from the external world. They have nothing to gain or lose by any action; neither people nor things can affect their security.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"Strive constantly to serve the welfare of the world; by devotion to selfless work, one attains the supreme goal of life. Do your work with the welfare of others always in mind.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"Even the wise act within the limitations of their own nature.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"The senses have been conditioned by attraction to the pleasant and aversion to the unpleasant. Do not be ruled by them; they are obstacles in your path.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"Just as a fire is covered by smoke and a mirror is obscured by dust, just as the embryo rests deep within the womb, knowledge is hidden by selfish desire - hidden, Arjuna, by this unquenchable fire for self-satisfaction, the inveterate enemy of the wise.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 3\",\n        prompt: \"\"\n    },\n    {\n        text: \"As they approach me, so I receive them. All paths, Arjuna, lead to me.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"Actions do not cling to me because I am not attached to their results. Those who understand this and practice it live in freedom.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"The awakened sages call a person wise when all his undertakings are free from anxiety about results; all his selfish desires have been consumed in the fire of knowledge. The wise, ever satisfied, have abandoned all external supports. Their security is unaffected by the results of their action; even while acting, they really do nothing at all.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"They live in freedom who have gone beyond the dualities of life. Competing with no one, they are alike in success and failure and content with whatever comes to them. They are free, without selfish attachments; their minds are fixed in knowledge. They perform all work in the spirit of service and their karma is dissolved.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"Even if you were the most sinful of sinners, Arjuna,  you could cross beyond all sin by the raft of spiritual wisdom. As the heat of a fire reduces wood to ashes, the fire of knowledge burns to ashes all karma. Nothing in this world purifies like spiritual wisdom. It is the perfection achieved in time through the path of yoga, the path which leads to the Self within.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those who take wisdom as their highest goal, whose faith is deep and whose senses are trained, attain wisdom quickly and enter into perfect peace.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those established in the Self have renounced selfish attachments to their actions and cut through doubts with spiritual wisdom. They act in freedom.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 4\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those who follow the path of service, who have completely purified themselves and conquered their senses and self-will, see the Self in all creatures and are untouched by any action they perform.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those who surrender to Brahman all selfish attachments are like the leaf of a lotus floating clean and dry in water. Sin cannot touch them.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those whose consciousness is unified abandon all attachment to the results of action and attain supreme peace. But those whose desires are fragmented, who are selfishly attached to the results of their work, are bound in everything they do.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"Judgement is clouded when wisdom is obscured by ignorance. But ignorance is destroyed by knowledge of the Self within. The light of this knowledge shines like the sun, revealing the supreme Brahman.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those who possess this wisdom have equal regard for all. They see the same Self in a spiritual aspirant and an outcaste, in an elephant, a cow, and a dog. Such people have mastered life.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"“Not dependent on any external support, they realize the joy of spiritual awareness. With consciousness unified through meditation, they live in abiding joy.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"But those who overcome the impulses of lust and anger which arise in the body are made whole and live in joy. They find their joy, their rest, and their light completely within themselves.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"Closing their eyes, steadying their breathing, and focusing their attention on the center of spiritual consciousness, the wise master their senses, mind, and intellect through meditation. Self-realization is their only goal. Freed from selfish desire, fear, and anger, they live in freedom always. Knowing me as the friend of all creatures, the Lord of the universe, the end of all offerings and all spiritual disciplines, they attain eternal peace.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 5\",\n        prompt: \"\"\n    },\n    {\n        text: \"It is not those who lack energy or refrain from action, but those who work without expectation of reward who attain the goal of meditation. Theirs is true renunciation. Therefore, Arjuna, you should understand that renunciation and the performance of selfless service are the same. Those who cannot renounce attachment to the results of their work are far from the path.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"Reshape yourself through the power of your will; never let yourself be degraded by self-will. The will is the only friend of the Self, and the will is the only enemy of the Self.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"To those who have conquered themselves, the will is a friend. But it is the enemy of those who have not found the Self within them.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"The supreme Reality stands revealed in the consciousness of those who have conquered themselves. They live in peace, alike in cold and heat, pleasure and pain, praise and blame.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"Make your mind one-pointed in meditation, and your heart will be purified.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"Arjuna, those who eat too much or eat too little, who sleep too much or sleep too little, will not succeed in meditation. But those who are temperate in eating and sleeping, work and recreation, will come to the end of sorrow through meditation.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"When meditation is mastered, the mind is unwavering like the flame of a lamp in a windless place. In the still mind, in the depths of meditation, the Self reveals itself. Beholding the Self by means of the Self, an aspirant knows the joy and peace of complete fulfillment.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"Having attained that abiding joy beyond the senses, revealed in the stilled mind, they never swerve from the eternal truth. They desire nothing else, and cannot be shaken by the heaviest burden of sorrow.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"Wherever the mind wanders, restless and diffuse in its search for satisfaction without, lead it within; train it to rest in the Self. Abiding joy comes to those who still the mind.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"They see the Self in every creature and all creation in the Self. With consciousness unified through meditation, they see everything with an equal eye.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"When a person responds to the joys and sorrows of others as if they were his own, he has attained the highest state of spiritual union.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"It is true that the mind is restless and difficult to control. But it can be conquered, Arjuna, through regular practice and detachment. Those who lack self-control will find it difficult to progress in meditation; but those who are self-controlled, striving earnestly through the right means, will attain the goal.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"No one who does good work will ever come to a bad end, either here or in the world to come.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 6\",\n        prompt: \"\"\n    },\n    {\n        text: \"With your mind intent on me, Arjuna, discipline yourself with the practice of yoga. Depend on me completely. Listen, and I will dispel all your doubts; you will come to know me fully and be united with me.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 7\",\n        prompt: \"\"\n    },\n    {\n        text: \"Arjuna, I am the taste of pure water and the radiance of the sun and moon. I am the sacred word and the sound heard in air, and the courage of human beings. I am the sweet fragrance in the earth and the radiance of fire; I am the life in every creature and the striving of the spiritual aspirant.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 7\",\n        prompt: \"\"\n    },\n    {\n        text: \"My eternal seed, Arjuna, is to be found in every creature.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 7\",\n        prompt: \"\"\n    },\n    {\n        text: \"I am the power of discrimination in those who are intelligent, and the glory of the noble. In those who are strong, I am strength, free from passion and selfish attachment. I am desire itself, if that desire is in harmony with the purpose of life.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 7\",\n        prompt: \"\"\n    },\n    {\n        text: \"Unwavering in devotion, always united with me, the man or woman of wisdom surpasses all the others. To them I am the dearest beloved, and they are very dear to me.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 7\",\n        prompt: \"\"\n    },\n    {\n        text: \"All those who follow the spiritual path are blessed.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 8\",\n        prompt: \"\"\n    },\n    {\n        text: \"When you make your mind one-pointed through regular practice of meditation, you will find the supreme glory of the Lord.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 8\",\n        prompt: \"\"\n    },\n    {\n        text: \"The Lord is the supreme poet, the first cause, the sovereign ruler, subtler than the tiniest particle, the support of all, inconceivable, bright as the sun, beyond darkness.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 8\",\n        prompt: \"\"\n    },\n    {\n        text: \"This supreme Lord who pervades all existence, the true Self of all creatures, may be realized through undivided love.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 8\",\n        prompt: \"\"\n    },\n    {\n        text: \"There is merit in studying the scriptures, in selfless service, austerity, and giving, but the practice of meditation carries you beyond all these to the supreme abode of the highest Lord.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 8\",\n        prompt: \"\"\n    },\n    {\n        text: \"But truly great souls seek my divine nature. They worship me with a one-pointed mind, having realized that I am the eternal source of all. Constantly striving, they make firm their resolve and worship me without wavering. Full of devotion, they sing of my divine glory.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"Those who worship me and meditate on me constantly, without any other thought - I will provide for all their needs.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"Whatever I am offered in devotion with a pure heart - a leaf, a flower, fruit, or water - I accept with joy.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"Whatever you do, make it an offering to me - the food you eat, the sacrifices you make, the help you give, even your suffering.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"I look upon all creatures equally; none are less dear to me and none more dear. But those who worship me with love live in me, and I come to life in them.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"Even sinners become holy when they take refuge in me alone. Quickly their souls conform to dharma and they attain to boundless peace. Never forget this, Arjuna: no one who is devoted to me will ever come to harm.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"All those who take refuge in me, whatever their birth, race, sex, or caste, will attain the supreme goal; this realization can be attained even by those whom society scorns.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 9\",\n        prompt: \"\"\n    },\n    {\n        text: \"To those steadfast in love and devotion I give spiritual wisdom, so that they may come to me. Out of compassion I destroy the darkness of their ignorance. From within them I light the lamp of wisdom and dispel all darkness from their lives.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 10\",\n        prompt: \"\"\n    },\n    {\n        text: \"As for those who seek the transcendental Reality, without name, without form, contemplating the Unmanifested, beyond the reach of thought and of feeling, with their senses subdued and mind serene and striving for the good of all beings, they too will verily come unto me.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"Still your mind in me, still your intellect in me, and without doubt you will be united with me forever. If you cannot still your mind in me, learn to do so through the regular practice of meditation. If you lack the will for such self-discipline, engage yourself in my work, for selfless service can lead you at last to complete fulfillment. If you are unable to do even this, surrender yourself to me, disciplining yourself and renouncing the results of all your actions.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"That one I love who is incapable of ill will, who is friendly and compassionate. Living beyond the reach of ‘I’ and ‘mine’ and of pleasure and pain, patient, contented, self-controlled, firm in faith, with all their heart and all their mind given to me - with such as these I am in love.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"Not agitating the world or by it agitated, they stand above the sway of elation, competition, and fear: that one is my beloved.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"They are detached, pure, efficient, impartial, never anxious, selfless in all their undertakings; they are my devotees, very dear to me.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"That one is dear to me who runs not after the pleasant or away from the painful, grieves not, lusts not, but lets things come and go as they happen.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"That devotee who looks upon friend and foe with equal regard, who is not buoyed up by praise nor cast down by blame, alike in heat and cold, pleasure and pain, free from selfish attachments, the same in honor and dishonor, quiet, ever full, in harmony everywhere, firm in faith - such a one is dear to me.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 12\",\n        prompt: \"\"\n    },\n    {\n        text: \"They alone see truly who see the Lord the same in every creature, who see the deathless in the hearts of all that die. Seeing the same Lord everywhere, they do not harm themselves or others. Thus they attain the supreme goal.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 13\",\n        prompt: \"\"\n    },\n    {\n        text: \"Established within themselves, they are equal in pleasure and pain, praise and blame, kindness and unkindness. Clay, a rock, and gold are the same to them. Alike in honor and dishonor, alike to friend and foe, they have given up every selfish pursuit.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 14\",\n        prompt: \"\"\n    },\n    {\n        text: \"Not deluded by pride, free from selfish attachment and selfish desire, beyond the duality of pleasure and pain, ever aware of the Self, the wise go forward to that eternal goal. Neither the sun nor the moon nor fire can add to that light.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 15\",\n        prompt: \"\"\n    },\n    {\n        text: \"Be fearless and pure; never waver in your determination or your dedication to the spiritual life. Give freely. Be self-controlled, sincere, truthful, loving, and full of the desire to serve. Realize the truth of the scriptures; learn to be detached and to take joy in renunciation. Do not get angry or harm any living creature, but be compassionate and gentle; show good will to all. Cultivate vigor, patience, will, purity; avoid malice and pride. Then, Arjuna, you will achieve your divine destiny.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 16\",\n        prompt: \"\"\n    },\n    {\n        text: \"To offer service to the gods, to the good, to the wise, and to your spiritual teacher; purity, honesty, continence, and nonviolence: these are the disciplines of the body. To offer soothing words, to speak truly, kindly, and helpfully, and to study the scriptures: these are the disciplines of speech. Calmness, gentleness, silence, self-restraint, and purity: these are the disciplines of the mind.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 17\",\n        prompt: \"\"\n    },\n    {\n        text: \"But to fulfill your responsibilities knowing that they are obligatory, while at the same time desiring nothing for yourself - this is sattvic renunciation.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 18\",\n        prompt: \"\"\n    },\n    {\n        text: \"As long as one has a body, one cannot renounce action altogether. True renunciation is giving up all desire for personal reward.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 18\",\n        prompt: \"\"\n    },\n    {\n        text: \"By performing one’s own work, one worships the Creator who dwells in every creature. Such worship brings that person to fulfillment.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 18\",\n        prompt: \"\"\n    },\n    {\n        text: \"It is better to perform one’s own duties imperfectly than to master the duties of another.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 18\",\n        prompt: \"\"\n    },\n    {\n        text: \"Remembering me, you shall overcome all difficulties through my grace.\",\n        citation: \"The Bhagavad Gita - Eknath Easwaran Translation - Chapter 18\",\n        prompt: \"\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./lib/krishna-quotes.ts\n");

